Benannte Views
Manchmal muss man mehrere Views zur selben Zeit darstellen, anstatt sie zu verschachteln. Zum Beispiel bei einem Layout mit Hauptteil und Seitenleiste. Hier sind benannte Views n√ºtzlich. Anstelle eines einzigen Outlets f√ºr die View-Darstellung gibt es mehrere, die Namen tragen k√∂nnen. Ein router-view ohne Namen hei√üt standardm√§√üig default.




Ein View wird durch eine Komponente gerendert, deswegen ben√∂tigen mehrere Views auch mehrere Komponenten f√ºr dieselbe Route. Dabei ist es wichtig, components (Plural) in den Optionen zu verwenden:
const router = new VueRouter({
  routes: [
    {
      path: '/',
      components: {
        default: Foo,
        a: Bar,
        b: Baz
      }
    }
  ]
})

