advanced/navigation-guards.html.body:
Navigation Guards ("Navigations-W√§chter")
Wie der Name schon andeutet, werden "navigation guards" vue-router prim√§r genutzt, um Navigationen zu "bewachen", indem diese bei Bedarf redirected oder abgebrochen werden. Es gibt dabei verschiedene M√∂glichkeiten, sich in den Navigationsprozess einzuklinken: global, in der Route Definition oder direkt in der Komponente.
Hinweis: Guards werden nicht ausgel√∂st, wenn Params oder Querys ge√§ndert werden. Beobachte in diesen F√§llen einfach das $route-Objekt, um auf √Ñnderungen zu reagieren.
Globale Guards
Man kann globale Before-Guards ("davor-guards") mit router.beforeEach registrieren:
const router = new VueRouter({ ... })

router.beforeEach((to, from, next) => {
  // ...
})

Globale Before-Guards werden in der Reihenfolge aufgerufen, in der sie registriert wurden, wann immer eine Navigation ausgel√∂st wird. Der guard lann auch auch asynchron beendet werden - die Navigation ist solange im Status pending, bis alle bearbeitet wurden.
Jede Guard Funktion erh√§lt drei Argumente:

to: Route: das Route-Objekt, zu dem navigiert wird

from: Route: die aktuelle Route, von der wegnavigiert wird

next: Function: Diese Funktion muss aufgerufen werden, um den guard zu beenden. Die daraus resultierende Aktion h√§ngt von den Argumenten in next ab:

next(): Gehe zum n√§chsten guard in der Reihe. Wenn keine mehr vorhanden sind, ist die Navigation best√§tigt.

next(false): Brich die aktuelle Navigation ab. Wurde die URL ge√§ndert (entweder manuell durch den Nutzer oder √ºber den Zur√ºck-Button), wird sie zur√ºckgesetzt auf die der from-Route.

next('/') or next({ path: '/' }): Umleitung zu einer anderen Route. Die aktuelle Navigation wird abgebrochen und eine neue gestartet.




Die next-Funktion muss immer aufgerufen werden, sonst kann der Guard nicht aufgel√∂st werden.
Man kann auch globale After-Guards ("Danach-Guards") registrieren, allerdings erhalten diese keine next-Funktion wie der Navigationsschutz und beeinflussen nicht die Navigation selbst:
router.afterEach((to, from) => {
  // ...
})

Guards in der Route
Man kann den beforeEnter-Guard direkt in der Router-Konfiguration definieren:
const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      beforeEnter: (to, from, next) => {
        // ...
      }
    }
  ]
})

Diese Guards haben die exakt gleiche Signatur wie globale Before-Guards.
Guards in Komponenten
Zu guter Letzt kann man Guards auch direkt in den Route-Komponenten (die, die der Router-Konfiguration hinzugef√ºgt werden) mit beforeRouteEnter und beforeRouteLeave definieren:
const Foo = {
  template: `...`,
  beforeRouteEnter (to, from, next) {
    // Wird aufgerufen bevor die Route best√§tigt wird, die diese Komponenten rendert.
    // Hat keinen Zugriff auf den `this`-Kontext der Komponenteninstanz,
    // da diese noch nicht erstellt wurde, wenn die Guard-Funktion aufgerufen wird.
  },
  beforeRouteLeave (to, from, next) {
    // Wird aufgerufen, wenn von der Route, die diese Komponente rendert, wegnavigiert wird.
    // Hat Zugriff zum `this`-Kontext.
  }
}

Der beforeRouteEnter-Guard hat keinen Zugriff auf den this-Kontext, weil der Guard aufgerufen wird, bevor die Navigation best√§tigt wurde, weshalb die Komponente noch gar nicht erzeugt wurde.
Allerdings bekommt man Zugriff auf die Instanz, indem man einen Callback an next √ºbergibt. Der Callback wird ausgef√ºhrt wenn die Navigation best√§tigt wurde. Die Komponente wird im Callback als Argument √ºbergeben:
beforeRouteEnter (to, from, next) {
  next(vm => {
    // Zugriff auf Komponenteninstanz via 'vm'
  })
}

In beforeRouteLeave-Guards kann man den this-Kontext aufrufen. Dieser Guard wird normalerweise verwendet um zu verhindern, dass ein Benutzer die Route versehentlich verl√§sst ohne ungesicherten Arbeit zu speichern. Die Navigation kann mit next(false) abgebrochen werden.

advanced/meta.html.body:
Route Meta-Felder
In der Route-Definition kann man ein Meta-Feld definieren:
const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      children: [
        {
          path: 'bar',
          component: Bar,
          // ein Metafeld
          meta: { requiresAuth: true }
        }
      ]
    }
  ]
})

Und wie greifen wir auf das meta-Feld zu?
Zun√§chst einmal: Wir nennen jedes Route-Objekt in der routes-Konfiguration Route-Record. Route-Records k√∂nnen verschachtelt sein, weshalb eine URL potentiell zu mehreren Route-Records passen kann.
Zum Beispiel werden mit der obigen Konfiguration und der URL /foo/bar beide - Parent-Record und Child-Record - gematched.
Alle Route-Records, die auf eine URL zutreffen, sind im $route-Objekt und in den Route-Objekten in Navigation-Guards im $route.matched-Array zu finden. Deswegen m√ºssen wir mit einer Schleife das $route.matched Array durchlaufen, um alle Route-Records auf Metafelder zu pr√ºfen.
Ein Anwendungsfall ist die Pr√ºfung nach einem Metafeld im globalen Before-Guard:
router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.requiresAuth)) {
    // Diese Route ben√∂tigt Authentifizierung und pr√ºft,
    // ob man eingeloggt ist.
    // Wenn nicht, Redirect zur Login-Seite.
    if (!auth.loggedIn()) {
      next({
        path: '/login',
        query: { redirect: to.fullPath }
      })
    } else {
      next()
    }
  } else {
    next() // Rufe immer next() auf.
  }
})

