Laden vor der Navigation
In diesem Fall werden die Daten geladen, bevor wir in die neue Route navigieren. Die Inhalte werden in dem beforeRouteEnter-Guard der neuen Komponente geladen. Die next-Funktion wird erst aufgerufen, wenn der Vorgang abgeschlossen ist:
export default {
  data () {
    return {
      post: null,
      error: null
    }
  },
  beforeRouteEnter (to, from, next) {
    getPost(to.params.id, (err, post) => {
      if (err) {
        // Zeige eine globale Fehlermeldung.
        next(false)
      } else {
        next(vm => {
          vm.post = post
        })
      }
    })
  },
  // Wenn die Route ge√§ndert und die Komponente bereits gerendert wurde,
  // ist der Aufbau etwas anders:
  watch: {
    $route () {
      this.post = null
      getPost(this.$route.params.id, (err, post) => {
        if (err) {
          this.error = err.toString()
        } else {
          this.post = post
        }
      })
    }
  }
}

Der Nutzer bleibt im aktuellen View, w√§hrend die Daten f√ºr den neuen View geladen werden. Daher ist es w√§hrend des Ladevorgangs empfehlenswert, innerhalb der App einen Ladebalken oder √§hnliches anzuzeigen. Wenn der Ladevorgang fehlschl√§gt, ist es au√üerdem wichtig, eine Fehlermeldung auszugeben.

advanced/scroll-behavior.html.body:
Scroll-Verhalten
Oft wollen wir, dass die Seite nach oben scrollt, wenn zu einer neuen Route navigiert wird, oder dass die Scroll-Position von Verlaufseintr√§gen wie beim Neuladen einer Seite beibehalten wird. vue-router erm√∂glichst das und noch mehr - wir k√∂nnen das Scroll-Verhalten komplett individualisieren.

Merke: Dies funktioniert nur im HTML5-Verlaufsmodus ("history mode").

Beim Erzeugen der Router-Instanz f√ºgt man die scrollBehavior-Funktion hinzu:
const router = new VueRouter({
  routes: [...],
  scrollBehavior (to, from, savedPosition) {
    // zur√ºckgeben der gew√ºnschten Position
  }
})

Die scrollBehavior-Funktion erh√§lt die Route-Objeke to und from als Argumente. Das dritte Argument savedPosition steht nur zur Verf√ºgung, wenn es sich um eine popstate-Navigation handelt (d.h. der Vor-/Zur√ºck-Button des Browsers hat die Navigation ausgel√∂st).
Die Funktion sollte ein Objekt zur√ºckgeben, dass die Scroll-Position beschreibt. Das Objekt kann folgenderma√üen aussehen:

{ x: number, y: number }
{ selector: string }

Wenn ein falscher (falsy) Wert oder ein leeres Objekt zur√ºckgegeben wird, wird nicht gescrollt.
Im folgenden Beispiel scrollt die Seite komplett nach oben:
scrollBehavior (to, from, savedPosition) {
  return { x: 0, y: 0 }
}

Wenn die Funktion das savedPosition-Object zur√ºckgibt, verh√§lt sich die Seite wie ein Browser, innerhalb dessen mit den Vor-/Zur√ºck Buttons navigiert wird.
scrollBehavior (to, from, savedPosition) {
  if (savedPosition) {
    return savedPosition
  } else {
    return { x: 0, y: 0 }
  }
}

Simulation des "Scrolle zum Anchor"-Verhaltens:
scrollBehavior (to, from, savedPosition) {
  if (to.hash) {
    return {
      selector: to.hash
    }
  }
}

Du kannst au√üerdem die Route Meta-Felder f√ºr eine noch genauere Kontrolle des Scroll-Verhaltens nutzen.  Hier findest du ein Beispiel.

advanced/lazy-loading.html.body:
Lazy Loading
Wenn Apps mit einem Bundler erstellt werden, kann das erzeugte "Bundle" recht gro√ü werden und so die Seitenladezeit beeintr√§chtigen. Es w√§re effizienter, wenn man das Bundle in die einzelnen  Router-Komponenten aufteilen k√∂nnte und sie nur dann l√§dt, wenn die Route besucht wird.
Mit der Kombination von Vue's Feature f√ºr asynchrone Komponenten und Webpack's Feature "Code-Splitting" (engl. to split: teilen) ist es einfach, dieses "Lazy Loading" genannte Verhalten f√ºr Route-Komponenten zu erreichen.
Dazu m√ºssen wir nur unsere Route-Komponenten als asynchrone Komponente definieren:
const Foo = resolve => {
  // require.ensure ist Webpacks speziale Syntax f√ºr Code-Splitting.
  require.ensure(['./Foo.vue'], () => {
    resolve(require('./Foo.vue'))
  })
}

Es gibt auch eine alternative Code-Splitting Syntax mit require im AMD-Stil, mit der das ganze folgenderma√üen vereinfacht werden kann:
const Foo = resolve => require(['./Foo.vue'], resolve)

In der Route-Konfiguration muss nichts gen√§ndert werden - wir nutzen Foo wie gewohnt:
const router = new VueRouter({
  routes: [
    { path: '/foo', component: Foo }
  ]
})

Gruppierung von Komponenten im selben Chunk
Manchmal wollen wir alle Komponenten unter derselben Route in den selben ansynchronen Chunk gruppieren. Daf√ºr benutzern wir das "named Chunks" (englisch) Feature, indem wir einen Chunk-Namen als drittes Argument f√ºr require.ensure hinzuf√ºgen.
const Foo = r => require.ensure([], () => r(require('./Foo.vue')), 'group-foo')
const Bar = r => require.ensure([], () => r(require('./Bar.vue')), 'group-foo')
const Baz = r => require.ensure([], () => r(require('./Baz.vue')), 'group-foo')

Webpack b√ºndelt alle asynchronen Module mit dem gleichen Chunk-Namen in denselben asynchronen Chunk. Das bedeutet auch, dass keine Dependencies mehr f√ºr require.ensure explizit aufgelistet werden m√ºssen - daher das leere Array als Argument.

