api/route-object.html.body:
Das Route-Objekt
Das Route-Objekt repr√§sentiert den Zustand der aktuell aktiven Route. Es enth√§lt geparste Informationen zur aktuellen URL und den Route-Eintr√§gen, die mit der URL gematched wurden.
Das Route-Objekt ist 'immutable' (unver√§nderbar). Jede erfolgreiche Navigation resultiert in einem neuen Route-Objekt.
Das Route-Objekt kann an mehreren Orten gefunden werden:

in Komponenten als this.$route

in $route-Watcher-Callbacks.

als R√ºckgabewert von router.match(location)

in Navigation-Guards als die ersten beiden Argumente:
router.beforeEach((to, from, next) => {
  // 'to' und 'from' sind Router-Objekte
})


in der scrollBehavior-Funktion als die ersten beiden Argumente:
const router = new VueRouter({
  scrollBehavior (to, from, savedPosition) {
      // 'to' und 'from' sind Router-Objekte
  }
})



Eigenschaften des Router-Objekts

$route.path

Typ: string
Ein String, der gleich dem Pfad der aktuellen Route ist immer als absoluter Pfad ausgegeben wird, zB. "/foo/bar".



$route.params

Typ: Object
Ein Objekt, welches Schl√ºssel/Wert-Paare von Stern- und dynamischen Segmenten enth√§lt. Gibt es keine Parameter, ist der Wert ein leeres Objekt.



$route.query

Typ: Object
Ein Objekt, welches Schl√ºssel/Wert-Paare des Query-Strings enth√§lt. F√ºr den Pfad /foo?user=1 erh√§lt man zum Beispiel $route.query.user == 1. Gibt es kein Query, ist der Wert ein leeres Objekt.



$route.hash

Typ: string
Der Hash der aktuellen Route (mit #). Gibt es keinen Hash, ist dessen Wert ein leerer String.



$route.fullPath

Typ: string
Die voll umgewandelte URL inklusive Abfrage und Hash.



$route.matched

Typ: Array

Ein Array von Route-Eintr√§gen f√ºr alle verschachtelten Pfadsegmente der aktuellen Route. Route-Eintr√§ge sind Kopien der Objekte im Array der routes-Konfiguration (und deren children-Arrays):
const router = new VueRouter({
  routes: [
    // das folgende Objekt in ein Route-Eintrag
    { path: '/foo', component: Foo,
      children: [
        // das ist auch ein Route-Eintrag
        { path: 'bar', component: Bar }
      ]
    }
  ]
})

Wenn die URL /foo/bar ist, ist $route.matched ein Array, welches beide geklonten Objekte von Parent nach Child sortiert enth√§lt.

$route.name
Der Name der aktuellen Route, sofern vorhanden. Siehe Benannte Routes.
